import styled from 'styled-components'


export const HeaderContainer = styled.div `
    display: flex;
    justify-content: flex-end;
    align-items: center;
`;

export const Logo = styled.img `
    display: flex;
    justify-content: flex-end;
    align-items: center;
`;

export const Header = styled.header `
    display: flex;
    justify-content: flex-end;
    align-items: center;
`;
